import React from "react";
import "./ItemCard.css";

const ItemCard = ({ item }) => {
  return (
    <div className="itemCard">
      <div>
        <p className="text-large">{item.message}</p>
      </div>
      <div>
        <p className="text-small">expires at {item.expiresAt}</p>
      </div>
    </div>
  );
};

export default ItemCard;
